import React, { useState } from 'react';
import './App.css';
import { Item } from './types/item';
import { ListContainer } from './components/List/List';

function App() {

  const [todos, setTodoes] = useState<Item[]>([
    {
      id: 1, text: 'Learn Typescript', completed: false
    }
  ])

  return (
    <div className='main-container'>
      <div className='title'>Daily To-Do List</div>
       {todos.map((todo, index) => <ListContainer key={index + todo.id} /> )}  
      <button>Add</button>
    </div>
  );
}

export default App;
